window.bookSummaryJSON = "<p>Humphrey Bogart meets The Man in the High Castle.&nbsp;</p> <p>Eddie Evers was at the top of his game, working for the FBI, tracking missing children and the scum who took them. But after his wife and child are killed in a car crash, he becomes a hard-drinking PI. While in pursuit of a phantom criminal, he is hit by lightning.The bolt super-charges the biophotons in his brain, enabling him to see into other dimensions.</p>"; 
